#include <iostream>
#include <vector>
#include <string>
using namespace std;



		int main(){
			int n;
			cin >> n;
			int b = 0;
		
			for (int i = 1; i <= n; i++) {
				int count = 0;
				for (int j = 1; j <= i; j++) {
					if (i % j == 0) {
						count++;
					}
					if (count > 2) {
						break;
					}
				}
				if (count == 2) {
					
					b++;
				}
			}
			
			cout << b << endl;
}
